import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import Post from "@/components/Post"

import { waynedahlberg } from "@/authors";
import hero from "./hero-ranges.png";
export { getStaticProps } from "@/getStaticProps";
export const meta = {
  title: `Swift Ranges`,
  description: `The basics of Swift Enumerations.`,
  date: "2020-11-24T12:00:00.000Z",
  authors: [waynedahlberg],
  discussion: "https://github.com/tailwindlabs/tailwindcss/discussions/2511"
};
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  meta
};
const MDXLayout = (props) => <Post meta={meta} {...props} />
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">




    <img src={hero} alt="Swift Ranges hero image" />
    <p>{`Ranges are generic Swift Structures for selecting a range, or a limited subset, of an existing type. Ranges are used commonly for identifying elements between the lowest and highest values in a set.`}</p>
    <div class="rounded-md bg-blue-50 p-4">
  <div class="flex">
    <div class="flex-shrink-0">
      <svg class="h-5 w-5 text-blue-400" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor">
        <path fillRule="evenodd" d="M18 10a8 8 0 11-16 0 8 8 0 0116 0zm-7-4a1 1 0 11-2 0 1 1 0 012 0zM9 9a1 1 0 000 2v3a1 1 0 001 1h1a1 1 0 100-2v-3a1 1 0 00-1-1H9z" clipRule="evenodd" />
      </svg>
    </div>
    <div class="ml-3 flex-1 md:flex md:justify-between">
      <p class="text-sm leading-5 text-blue-700">
        This is a another post in a series intended as a personal growth
        exercise. As I learn and digest new things, I want to write about them
        to solidify my understanding.
      </p>
      <p class="mt-3 text-sm leading-5 md:mt-0 md:ml-6">
        <a href="https://fs.blog/2015/01/richard-feynman-knowing-something/" class="whitespace-no-wrap font-medium text-blue-700 hover:text-blue-600 transition ease-in-out duration-150">
          Feynman &rarr;
        </a>
      </p>
    </div>
  </div>
    </div>
    <h2>{`Kinds of Ranges`}</h2>
    <h3>{`Closed Range`}</h3>
    <p>{`A `}<em parentName="p">{`Closed Range`}</em>{` is declared with the `}<inlineCode parentName="p">{`...`}</inlineCode>{` operator between a pair of Integer values. The left value being the `}<inlineCode parentName="p">{`lowerBound`}</inlineCode>{` and the right value being `}<inlineCode parentName="p">{`upperBound`}</inlineCode>{`. The Closed Range `}<strong parentName="p">{`includes`}</strong>{` the upperBound value.`}</p>
    <pre {...{
      "className": "language-swift"
    }}><code parentName="pre" {...{
        "className": "language-Swift"
      }}><span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`let`}</span>{` range `}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`:`}</span>{` `}<span parentName="code" {...{
          "className": ""
        }}>{`ClosedRange`}</span>{` `}<span parentName="code" {...{
          "className": ""
        }}>{`=`}</span>{` `}<span parentName="code" {...{
          "className": ""
        }}>{`0`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`.`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`.`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`.`}</span><span parentName="code" {...{
          "className": ""
        }}>{`5`}</span>{`
`}<span parentName="code" {...{
          "className": "text-code-blue"
        }}>{`print`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`(`}</span>{`range`}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`)`}</span>{` `}<span parentName="code" {...{
          "className": "text-gray-400 italic"
        }}>{`// 0...5`}</span>{`
`}<span parentName="code" {...{
          "className": "text-code-blue"
        }}>{`print`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`(`}</span>{`range`}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`.`}</span><span parentName="code" {...{
          "className": ""
        }}>{`first`}</span><span parentName="code" {...{
