        }}>{`)`}</span>{` `}<span parentName="code" {...{
          "className": "text-gray-400 italic"
        }}>{`// Optional(0)`}</span>{`
`}<span parentName="code" {...{
          "className": "text-code-blue"
        }}>{`print`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`(`}</span>{`range`}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`.`}</span><span parentName="code" {...{
          "className": ""
        }}>{`last`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`)`}</span>{` `}<span parentName="code" {...{
          "className": "text-gray-400 italic"
        }}>{`// Optional(10)`}</span>{`

`}<span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`for`}</span>{` index `}<span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`in`}</span>{` range `}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`{`}</span>{`
  `}<span parentName="code" {...{
          "className": "text-code-blue"
        }}>{`print`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`(`}</span>{`index`}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`)`}</span>{` `}<span parentName="code" {...{
          "className": "text-gray-400 italic"
        }}>{`// prints consecutivly, values from 0 to 5`}</span>{`
`}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`}`}</span>{`
`}</code></pre>

    </MDXLayout>;
}

